import { useParams } from "react-router-dom";
import { planets } from "../MatematicaParaConcursos";
import "../../../../../styles/courses/math/planetsLayout.css";

function PlanetPage() {
  const { id } = useParams();
  const planet = planets.find(c => c.id === id);

  if(!planet){
    return <p>Curso não encontrado.</p>
  }

  return(
    <div className="HomePageGlobalDiv">
      <div className="NousNovaPlanetsLayout">
        {/* Cabeçalho */}
        <section id="title">
          <h1>{planet.name} |</h1>
          <h3>{planet.motivation}</h3>
        </section>

        {/* Visit */}
        <section>
          <h2>{planet.title}</h2>
          <p>{planet.title_content}</p>
        </section>

        <section>
          <h2>{planet.subTitle}</h2>
          <p>{planet.subTitle_content}</p>
        </section>
      </div>
    </div>
  )
}

export default PlanetPage;
